class RegisterComponent {
    constructor(router, regiService, ngxService, authservice) {
        this.router = router;
        this.regiService = regiService;
        this.ngxService = ngxService;
        this.authservice = authservice;
        this.registerform = {};
    }
    ngOnInit() {
        this.registerform.user = {};
        this.loggedin = this.authservice.isLoggedIn();
    }
    register() {
        if (this.loggedin) {
            this.registerform.Role = "Admin";
        }
        else {
            this.registerform.Role = "Normal";
        }
        if (!this.registerform.user.name) {
            var title = 'Alert';
            var body = 'Please enter name';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.email) {
            var title = 'Alert';
            var body = 'Please enter Email Id';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.telephone) {
            var title = 'Alert';
            var body = 'Please enter Telephone Number';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.companyName) {
            var title = 'Alert';
            var body = 'Please enter Company name';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.license) {
            var title = 'Alert';
            var body = 'Please enter License Number ';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.panId) {
            var title = 'Alert';
            var body = 'Please enter Pan Number';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        else if (!this.registerform.user.aadhar) {
            var title = 'Alert';
            var body = 'Please enter Aadhar Number';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        if (!this.registerform.Password) {
            var title = 'Alert';
            var body = 'Please enter password';
            this.alertPopupComponent.alertMessage(title, body);
            return false;
        }
        this.registerform.UserName = this.registerform.user.name;
        this.ngxService.start();
        this.regiService.registerUser(this.registerform).subscribe((res) => {
            this.res = res;
            this.ngxService.stop();
            if (!res) {
                var title = 'Alert';
                var body = 'Please register again';
                this.alertPopupComponent.alertMessage(title, body);
            }
            else {
                var title = 'Alert';
                var body = ' register Sucessfully';
                this.alertPopupComponent.alertMessage(title, body);
                this.registerform = {};
                this.registerform.user = {};
            }
        }, (error) => {
            this.ngxService.stop();
            var title = 'Alert';
            var body = 'Please register again';
            this.alertPopupComponent.alertMessage(title, body);
            console.log(error);
        });
    }
}
